import womanVrData from '../mockData/womanVrData';

const WomanVR = () => {
  return (
    <section className="woman-vr-section">
      <div className="woman-vr__image">
        <img src={womanVrData.imageSrc} alt={womanVrData.altText} />
      </div>
      <div className="woman-vr__content">
        <h2 className="woman-vr__title">{womanVrData.title}</h2>
        <p className="woman-vr__description">{womanVrData.description}</p>
        <button className="woman-vr__button">{womanVrData.buttonText}</button>
      </div>
    </section>
  );
};

export default WomanVR;
